import { createApp } from 'vue'
import App from './App.vue'
import router from './router'
import store from './store'

// Base components
import BaseCard from './components/UI/BaseCard.vue'

// Global css
import './assets/global.css'

const app = createApp(App)

app.use(store)
app.use(router)

// 

app.mount('#app')
